@jonathan-hurley ,
The old log configs `ranger_admin_log_dir`, `ranger_usersync_log_dir` in ranger-env.xml when updated don't give restart indicator on Ranger service. ranger-env is not added as configuration-dependencies in metainfo.xml for Ranger service ( which is not required as well ).

Ambari-2.7.1 with stack 3.0 should use the updated log configs. For an existing cluster with Ambari-2.7.0, will also need to use the updated configs after performing an upgrade to Ambari-2.7.1.
